webpackJsonp([0xa701f712fc59],{1322:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2008-07-16-iphone-apps-eh/index.md absPath of file >>> MarkdownRemark",html:"<p>I was pretty excited to see the new app store show up on iTunes. As a faithful fan of everything Apple I was looking forward to this big event.</p>\n<p>Now?</p>\n<p>Meh, I could take it or leave it. I just spent half an hour browsing through the applications. I downloaded some because they are there, but really who is going to pay 10 bucks for Tetris? I have to believe that the platform is going to provide an opportunity for some killer app that hasn't been thought of as of yet. I would really love a shell so I can ssh into my servers. Until then all I have to say is what's the big deal eh?</p>",frontmatter:{title:"iPhone Apps, meh..",date:"July 16, 2008",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{path:"/iphone-apps-eh"}}}});
